import React from 'react';

const Lastpunch = ({ latestpunch }) => {
    const {location, inout, date, time } = latestpunch;
    console.log(date)
    if (location || inout || date || time) {
        return (
            <article class="mw5 center bg-white br3 pa3 pa4-ns mv3 ba b--black-10">
                <div class="tc">
                    <h1 class="f4">Last Punch</h1>
                    <hr class="mw3 bb bw1 b--black-10" />
                </div>
                    <label className="db">{`Last Punch`}</label>
                    <label className="db">{`Place: ${location}`}</label>
                    <label className="db">{`In/Out: ${inout}`}</label>
                    <label className="db">{`Date: ${date.substring(0,10)}`}</label>
                    <label className="db">{`Time: ${time.substring(0,8)}`}</label>
            </article>
        )
    } else {
        return (
            <div></div>
        )
    }
}

export default Lastpunch;
